Chart.defaults.onClick = function(event,chartElements) {

Chart.defaults.scales.linear.ticks.callback = function(value, index, values) {
    
    if(value >= 1000000000){
        return (value / 1000000000) + "B"
    }
    if(value >= 1000000){
        return (value / 1000000) + "M"
    }
    if(value >= 1000){
        return (value / 1000) + "K"
    }

    return value;
}
    
Chart.defaults.elements.line.borderDash = function(context) {
    return context.dataset.label.includes('2D') ? [15,10] :
        context.dataset.label.includes('3D') ? [40,10] : [];
}

Chart.defaults.elements.point.backgroundColor = function(context) {
    colors = ['tomato','limegreen','deepskyblue','orchid'];
    match = ['AVX512','AVX2','SSE41','SSE2'];
    idx = match.findIndex(s => context.dataset.label.includes(s));
    return idx >= 0 ? colors[idx] : 'slategrey';
}

Chart.defaults.elements.line.borderColor = function(context) {
    return Chart.helpers.color(Chart.defaults.elements.point.backgroundColor(context)).alpha(0.5).rgbString();
}
Chart.defaults.elements.line.backgroundColor = function(context) {
    return Chart.helpers.color(Chart.defaults.elements.point.backgroundColor(context)).alpha(0.15).rgbString();
